value:
({
  value,
  extra,
  onChange,
}) => {
  //console.log({ value, extraOptions: extra.options });
  return (
    <Select
      autoSuggest={extra.autoSuggest}
      // containerClassName={UI.input}
      className={UI.selectInput}
      title={extra.title || ""}
      options={extra.options}
      value={value}
      onChange={(value) => {
        if (value) {
          onChange(value);
        }
      }}
    />
  );
}
